import React from 'react'
import Visualize from './Visualize.js'
import Reset from './Reset.js'

const Header = ({ rows, cols, padding, height, gridState, setGridState, startCord, targetCord, resetBoard }) => {

    const style = {
        padding: padding,
        height: height
    };

    return (
        <div className='header'>
            <Visualize rows={rows} cols={cols} gridState={gridState} setGridState={setGridState} startCord={startCord} targetCord={targetCord} />
            <Reset resetBoard={resetBoard} />
        </div>
    )
}

export default Header
